import ReactDOM from 'react-dom';
import './index.css';

// react router
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
// pages
import Home from './Home';
import About from './About';


const App = () => {
return (
    <>
<Router>
<Route exact path="/">
<Home></Home>
</Route>
<Route exact path="/About">
<About></About>

</Route>

{/* 
